import { useEffect, useState } from "react";

function Id({ formData, setFormData }) {
    return (
        <div className="form-group">
            <label htmlFor="userId">사용자 아이디</label>
            <input
              type="text"
              id="userId"
              name="userId"
              value={formData.id}
              onChange={() => {setFormData({...formData, id:e.target.value})}}
              required
            />
          </div>
    );
}

export default Id;
